import React from 'react'

export default class Login extends React.Component {
  render() {
    return(
      <div style={styleLogin}>
        Login
        <input type="text"/>
      </div>
    )
  }
}

const styleLogin = {
  display: "flex", 
  flexDirection: "column",
  textAlign: "center",
  Back
}
